(3, 'MAHANATI', 'THRILLER, ', 3.50, 'Savitri, an energetic and jubilant child, grows up to become an actress. She faces several challenges and overcomes hurdles to become the first female superstar in South India.', 'SRI VENKATESWARA KALA MANDIR', '9:00 AM, 2:30PM, 6:00 PM, 9:00 P', 'sadf dsa fdas  updated', '8520998113', '5b55c5495d438.jpeg', 'INACTIVE', 'Approved', '', 1, '2018-07-21 11:23:00', 50, '2018-08-15 22:43:09', 1),
(4, 'Seven', 'THRILLER, ', 2.75, 'Seven’s story begins with an interesting premise, where Ramya (Nandita Swetha), a techie at an IT firm in Hyderabad, files a police complaint after her husband and colleague Karthik (Havish) goes missing. During the investigation, the inspector (Rahman) realizes that the Karthik-Ramya story is eerily similar to that of Jenny’s, who had already complained about her missing husband, Karthik again.\r\n\r\nWhile an investigation for both the cases is on, a hearing and speech impaired girl (Aditi Arya), too, files a similar complaint in Chennai. By now, the inspector is sure that Karthik is the main culprit and that he cheated several women in the name of love and marriage. In a dramatic turn of events, Karthik surrenders himself to the cops and pleads innocence.\r\n\r\nThen comes Priya (Tridha), who flies down from Mumbai to file a similar complaint. Now, a series of incidents lead to a flashback that takes place in a village, showcasing a triangle love story between Krishna Murthy (Havish), Saraswathi (Regina) and Bhanu (Pujita). The suspense in the story is all about the ‘Seventh’ person and how Krishna Murthy and Saraswathi’s story is connected to Karthik and all the girls.', 'PADMASREE THEATRE', '10.30am, 2.30pm, 6.30pm, 9.30pm', 'main road parvathipuram\r\n', '08963221050', '5cfa4b3f1bd0e.jpg', 'ACTIVE', 'Approved', '', 50, '2018-07-29 22:43:05', 51, '2019-06-07 21:02:23', 1),
(5, ' Hippi', 'COMEDY, ', 2.50, 'Hippi Devadas (Kartikeya), who is already in a relationship with a girl named Sneha, falls for her close friend Amuktamalyada (Digangana Suryavanshi) and breaks up with the first girl. After a constant pursuit by Deva, Amuktamalyada finally says yes to his proposal. The actual story begins when they both get into a serious relationship. What sort of insecurities will the young couple face during this course of time? Will they continue their relationship and make it an everlasting one? To know this, you have to catch the film in theaters near you.', 'SOWNDARYA THEATRE', '10.30am, 2.30pm, 6.30pm, 9.30pm', 'MAIN ROAD, PARVATHIPURAM', '08963222002', '5cfa4c234d409.jpg', 'ACTIVE', 'Approved', '', 50, '2018-08-15 01:42:38', 51, '2019-06-07 21:06:03', 1),
(6, ' Maharshi', 'ACTION, DRAMA, ROMANCE, ', 4.00, 'Rishi, a millionaire businessman, returns to his homeland, where he becomes the champion of poor and downtrodden farmers. Directed by Vamsi Paidipally, Maharshi features Mahesh Babu \r\nand Pooja Hegde in central roles. ', 'TBR SCREEN-1', '10.30am, 2.30pm, 6.30pm, 9.30pm', 'MAIN ROAD, BOBBILI ROAD, PARVATHIPURAM', '9177142494', '5cd8ec9591065.jpg', 'ACTIVE', 'Approved', '', 50, '2018-08-15 01:44:37', 51, '2019-05-13 13:33:33', 1),
(7, 'Jersey', 'COMEDY, ', 3.50, 'Luck hasn''t always been in favour of Arjun, a gifted cricketer in his mid-thirties whose career has failed to take off. With everyone around him insisting that he should give up on his career, will Arjun have the courage of conviction to continue pursuing his dream? ', 'TBR SCREEN-2', '10.30am, 2.30pm, 6.30pm, 9.30pm', 'MAIN ROAD, BOBBILI ROAD, PARVATHIPURAM', '9177142494', '5ce22973c57e0.jpg', 'ACTIVE', 'Approved', '', 50, '2018-08-15 01:47:05', 51, '2019-05-20 13:44:43', 1),
(8, 'killer', 'ACTION, ROMANCE, ', 3.50, 'The film is based on a gritty murder which happens in an apartment. The cops start their investigation and to deal this case, a senior cop, Karthikeya(Arjun) is handed over the responsibility. In his investigation he comes to know that a mother and daughter played by Sita and Ashima are involved in the murder. But as the investigation thickens, things are revealed that a neighbor named Prabhakar(Vijay Anthony) is also involved. Now, why is he involved? What is the case? and What has Prabhakar go to do with the ladies forms the rest of the story.', 'SRI VENKATESWARA KALA MANDIR', '10.30am, 2.30pm, 6.30pm, 9.30pm', 'MAIN ROAD, PRAVTHIPURAM TOWN.', '08963222004', '5cfa4cf399931.jpg', 'ACTIVE', 'Approved', '', 50, '2018-08-15 01:52:01', 51, '2019-06-07 21:09:31', 1),
